import React from 'react';
class Prices extends React.Component {
    render() {
        const images = this.props.data.children;
        const list   = images.map(image => {
            return(  
                <div className="thumbnail">
                    <p><img src={image.data.url }></img></p>
                </div>
            )
        })
        return (
            {list}
        )
    }
}

export default Prices;
